<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>LMI Tract Lookup</title>
  <script src="https://cdn.tailwindcss.com"></script>
</head>
<body class="min-h-screen bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 text-white p-6">
  <div class="max-w-2xl mx-auto">
    <div class="text-center mb-6">
      <h1 class="text-2xl font-bold mb-1 bg-gradient-to-r from-blue-400 to-cyan-400 bg-clip-text text-transparent">
        LMI Tract Lookup
      </h1>
      <p class="text-slate-400 text-sm">Check if a property is in a Low-to-Moderate Income census tract</p>
    </div>

    <!-- Address Input -->
    <div class="bg-slate-800/50 rounded-2xl p-5 border border-slate-700 mb-5">
      <div class="grid grid-cols-1 gap-3 mb-4">
        <div>
          <label class="block text-slate-400 text-xs mb-1">Street Address</label>
          <input type="text" id="street" placeholder="1000 Main St"
            class="w-full bg-slate-900/50 border border-slate-600 rounded-lg px-3 py-2 text-white placeholder-slate-500 focus:outline-none focus:border-blue-500" />
        </div>
        <div class="grid grid-cols-3 gap-3">
          <div>
            <label class="block text-slate-400 text-xs mb-1">City</label>
            <input type="text" id="city" placeholder="Houston"
              class="w-full bg-slate-900/50 border border-slate-600 rounded-lg px-3 py-2 text-white placeholder-slate-500 focus:outline-none focus:border-blue-500" />
          </div>
          <div>
            <label class="block text-slate-400 text-xs mb-1">State</label>
            <input type="text" id="state" placeholder="TX" maxlength="2"
              class="w-full bg-slate-900/50 border border-slate-600 rounded-lg px-3 py-2 text-white placeholder-slate-500 focus:outline-none focus:border-blue-500" />
          </div>
          <div>
            <label class="block text-slate-400 text-xs mb-1">ZIP Code</label>
            <input type="text" id="zip" placeholder="77002" maxlength="5"
              class="w-full bg-slate-900/50 border border-slate-600 rounded-lg px-3 py-2 text-white placeholder-slate-500 focus:outline-none focus:border-blue-500" />
          </div>
        </div>
      </div>
      <button id="lookupBtn" onclick="handleLookup()"
        class="w-full py-2.5 bg-blue-600 hover:bg-blue-500 disabled:bg-slate-700 disabled:text-slate-500 rounded-xl font-medium transition-colors">
        Check LMI Status
      </button>
      <div id="status" class="mt-3 text-slate-400 text-sm text-center hidden"></div>
    </div>

    <!-- Error -->
    <div id="error" class="bg-red-900/30 border border-red-700 rounded-xl p-4 mb-5 text-red-300 text-sm hidden"></div>

    <!-- Results -->
    <div id="results" class="bg-slate-800/50 rounded-2xl p-5 border border-slate-700 mb-5 hidden">
      <div class="mb-4">
        <div class="text-slate-400 text-xs">Matched Address</div>
        <div id="matchedAddress" class="font-medium"></div>
      </div>
      <div class="text-center mb-4">
        <div class="text-slate-400 text-xs">Census Tract GEOID</div>
        <div id="geoid" class="font-mono text-lg"></div>
      </div>
      <div class="grid grid-cols-2 gap-4 mb-4">
        <div id="result2024" class="bg-slate-800/50 rounded-xl p-5 border border-slate-700"></div>
        <div id="result2022" class="bg-slate-800/50 rounded-xl p-5 border border-slate-700"></div>
      </div>
      <div class="grid grid-cols-3 gap-4 text-sm text-center">
        <div><div class="text-slate-400 text-xs">State FIPS</div><div id="stateFips" class="font-mono"></div></div>
        <div><div class="text-slate-400 text-xs">County FIPS</div><div id="countyFips" class="font-mono"></div></div>
        <div><div class="text-slate-400 text-xs">Tract</div><div id="tract" class="font-mono"></div></div>
      </div>
    </div>

    <!-- Recent -->
    <div id="recentSection" class="bg-slate-800/50 rounded-2xl p-5 border border-slate-700 mb-5 hidden">
      <div class="flex justify-between items-center mb-3">
        <span class="text-sm font-medium">Recent Lookups</span>
        <button onclick="clearRecent()" class="text-xs text-slate-400 hover:text-white">Clear</button>
      </div>
      <div id="recentList" class="space-y-1"></div>
    </div>

    <!-- Legend -->
    <div class="bg-slate-800/50 rounded-xl p-4 border border-slate-700 text-sm">
      <div class="grid grid-cols-5 gap-2 mb-2">
        <div class="flex items-center gap-1.5"><div class="w-2.5 h-2.5 rounded-full bg-gray-500"></div><span class="text-xs">Unknown</span></div>
        <div class="flex items-center gap-1.5"><div class="w-2.5 h-2.5 rounded-full bg-green-500"></div><span class="text-xs">Low<span class="text-green-400 ml-0.5">✓</span></span></div>
        <div class="flex items-center gap-1.5"><div class="w-2.5 h-2.5 rounded-full bg-blue-500"></div><span class="text-xs">Moderate<span class="text-green-400 ml-0.5">✓</span></span></div>
        <div class="flex items-center gap-1.5"><div class="w-2.5 h-2.5 rounded-full bg-amber-500"></div><span class="text-xs">Middle</span></div>
        <div class="flex items-center gap-1.5"><div class="w-2.5 h-2.5 rounded-full bg-purple-500"></div><span class="text-xs">Upper</span></div>
      </div>
      <p class="text-slate-500 text-xs">LMI = Low (&lt;50%) or Moderate (50-80%) of MSA median family income</p>
    </div>
  </div>

      2: { label: 'Moderate', color: '#3b82f6', isLMI: true },
      3: { label: 'Middle', color: '#f59e0b', isLMI: false },
      4: { label: 'Upper', color: '#a855f7', isLMI: false },
    };

    let recentSearches = JSON.parse(localStorage.getItem('lmi_recent_addr') || '[]');

    ['street', 'city', 'state', 'zip'].forEach(id => {
      document.getElementById(id).addEventListener('keydown', e => { if (e.key === 'Enter') handleLookup(); });

    function showStatus(msg) {
      const el = document.getElementById('status');
      el.textContent = msg;
      el.classList.toggle('hidden', !msg);
    }

    function showError(msg) {
      const el = document.getElementById('error');
      el.textContent = msg;
      el.classList.toggle('hidden', !msg);
    }

    function renderResultCard(elementId, year, level) {
      const el = document.getElementById(elementId);
      const info = INCOME_LEVELS[level] ?? INCOME_LEVELS[0];
      const isLMI = info.isLMI;
      const notFound = level === null || level === undefined;
      if (notFound) {
        el.innerHTML = '<div class="text-slate-400 text-sm mb-2">' + year + '</div><div class="text-slate-500">Not in dataset</div>';
      } else {
        el.innerHTML = '<div class="text-slate-400 text-sm mb-2">' + year + '</div>' +
          '<div class="text-2xl font-bold mb-2" style="color:' + (isLMI ? '#4ade80' : '#94a3b8') + '">' + (isLMI ? '✓ LMI Tract' : '✗ Not LMI') + '</div>' +
          '<span class="px-3 py-1 rounded-full text-sm font-medium" style="background-color:' + info.color + '20;color:' + info.color + '">' + info.label + ' Income</span>';
      }
    }

    function renderRecent() {
      const section = document.getElementById('recentSection');
      const list = document.getElementById('recentList');
      if (recentSearches.length === 0) { section.classList.add('hidden'); return; }
      section.classList.remove('hidden');
      list.innerHTML = recentSearches.map((r, i) => {
        const is2024LMI = INCOME_LEVELS[r.level2024]?.isLMI;
        return '<button onclick="loadRecent(' + i + ')" class="w-full text-left px-3 py-2 bg-slate-900/30 hover:bg-slate-700/50 rounded-lg flex justify-between items-center text-sm">' +
          '<span class="truncate flex-1 mr-2">' + r.displayAddress + '</span>' +
          '<span class="' + (is2024LMI ? 'text-green-400' : 'text-slate-500') + '">' + (is2024LMI ? 'LMI' : 'Not LMI') + '</span></button>';
      }).join('');
    }

    function loadRecent(i) {
      const r = recentSearches[i];
      document.getElementById('street').value = r.street;
      document.getElementById('city').value = r.city;
      document.getElementById('state').value = r.state;
      document.getElementById('zip').value = r.zip;
      showResult(r);
    }

    function clearRecent() {
      recentSearches = [];
      localStorage.removeItem('lmi_recent_addr');
      renderRecent();
    }

    function showResult(r) {
      document.getElementById('matchedAddress').textContent = r.matchedAddress || r.displayAddress;

      document.getElementById('countyFips').textContent = r.countyFips;
      document.getElementById('tract').textContent = r.tract;
      renderResultCard('result2024', '2024-2025', r.level2024);
      renderResultCard('result2022', '2022-2023', r.level2022);
      document.getElementById('results').classList.remove('hidden');
      showError('');
    }

    function handleLookup() {
      const street = document.getElementById('street').value.trim();
      const city = document.getElementById('city').value.trim();
      const state = document.getElementById('state').value.trim();
      const zip = document.getElementById('zip').value.trim();

      if (!street || !city || !state) {
        showError('Please enter street address, city, and state');
        return;
      }

      showError('');
      document.getElementById('results').classList.add('hidden');
      const btn = document.getElementById('lookupBtn');
      btn.disabled = true;
      btn.textContent = 'Searching...';
      showStatus('Looking up address...');

      const callbackName = 'cb_' + Date.now();
      const timeout = setTimeout(() => {
        cleanup();
        showError('Request timed out. Please try again.');
        btn.disabled = false;
        btn.textContent = 'Check LMI Status';
        showStatus('');
      }, 20000);

      function cleanup() {
        clearTimeout(timeout);
        delete window[callbackName];
        const s = document.querySelector('script[data-cb="' + callbackName + '"]');
        if (s) s.remove();
      }

      window[callbackName] = function(data) {
        cleanup();
        btn.disabled = false;
        btn.textContent = 'Check LMI Status';
        showStatus('');

        const matches = data?.result?.addressMatches;
        if (!matches || !matches.length) {
          showError('Address not found. Please check and try again.');
          return;
        }

        const match = matches[0];
        const tractInfo = match.geographies?.['Census Tracts']?.[0];
        if (!tractInfo?.GEOID) {
          showError('Could not determine census tract.');
          return;
        }

        const geoid = tractInfo.GEOID;
        const result = {
          street, city, state, zip,
          displayAddress: street + ', ' + city + ', ' + state + ' ' + zip,
          matchedAddress: match.matchedAddress,
          geoid: geoid,
          stateFips: tractInfo.STATE,
          countyFips: tractInfo.COUNTY,
          tract: tractInfo.TRACT,
          level2024: TRACT_DATA['2024']?.[geoid] ?? null,
          level2022: TRACT_DATA['2022']?.[geoid] ?? null
        };

        showResult(result);
        recentSearches = [result, ...recentSearches.filter(s => s.geoid !== geoid)].slice(0, 10);
        localStorage.setItem('lmi_recent_addr', JSON.stringify(recentSearches));
        renderRecent();
      };

      const params = new URLSearchParams({
        street: street,
        city: city,
        state: state,
        zip: zip,
        benchmark: 'Public_AR_Current',
        vintage: 'Current_Current',
        format: 'jsonp'
      });

      const script = document.createElement('script');
      script.src = 'https://geocoding.geo.census.gov/geocoder/geographies/address?' + params + '&callback=' + callbackName;
      script.dataset.cb = callbackName;
      script.onerror = function() {
        cleanup();
        showError('Failed to connect to Census geocoder. Please try again.');
        btn.disabled = false;
        btn.textContent = 'Check LMI Status';
        showStatus('');
      };
      document.body.appendChild(script);
    }

    renderRecent();
  </script>
</body>
</html>
